import { Col, Card, Row, Container } from "react-bootstrap";

function Cardie (props){
    return(
        <div>

            <Container>
                <h4>{props.name}</h4>
                <p>{props.para}</p>
            </Container>
        </div>
    )
}

const Footer = () => {
    return (
        <Container>
        <Row style={{ position: "absolute", paddingTop: "100pt", paddingBottom: "100pt", left:"0" , right:"0"}}>
            <Col>    
                <Cardie name="Products" para=""/>
            </Col>      
            <Col> 
                <Cardie name="About" /> 
            </Col>
            <Col>    
                <Cardie name= "Contact"/>  
            </Col>
        </Row>
        </Container>
     );
}

export default Footer;
